import { PageService } from './service/page.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'app_answer';
  constructor(private pageService:PageService){}

  getCommentData(){
    this.pageService.getComment()
  }

}
